import React, { Component, Fragment } from "react";
import { BrowserRouter as Router } from "react-router-dom";

import "./App.css";

class App extends Component {
  render() {
    return (
      <Router>
        <Fragment>
          <div className="App" />
        </Fragment>
      </Router>
    );
  }
}

export default App;
